#include <string>
#include <iostream>

using namespace std;

//
bool isAnagram(string s, string t)
{
    int used[26];    //a - 97


    for(int i = 0 ; i < 26 ; i++)
    {
        used[i] = 0;
    }

    for(char a : s)
    {
        used[(int)a - 97]++;
    }

    for(char b : t)
    {
        used[(int)b - 97]--;


    }

    for(int i = 0 ; i < 26 ; i++)
    {
        cout<<"used["<<i<<"]: "<<used[i]<<endl;
        if(used[i])
        {
            return false;
        }
    }

    return true;
}

int main()
{
    string a = "";

    string b = "";

    cout<<isAnagram(a, b)<<endl;
}
